import React from "react";
import { useState } from "react";
import { Component } from "react";

function App(){

    const [stater,setStater]=useState(0)
    return(
        <>
        <button onClick={()=> setStater(stater++)}>Click Here</button>
        <p>{stater}</p>
        </>
    )

}


export default App
    
